import './styles/App.css';
import NavBar from './components/NavBar/NavBar.js';
import Main from './pages/main.js'
import About from './pages/about';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Main />
      <About />
      

    </div>
  );
}

export default App;
